import ExpenseItem from './ExpenseItem';

function Expenses( expenses ) {

    let index = 0;
    const title = expenses[index].title;
    const amount = expenses[index].amount;
    const date = expenses[index].date;


    return (
        <ExpenseItem 
            title={title} 
            amount={amount} 
            date={date}
        ></ExpenseItem>
    );
}

export default Expenses;
